Welcome (2009)


Frankrijk
Drama
115 minuten

geregisseerd door Philippe Lioret
met Vincent Lindon, Firat Ayverdi en Audrey Dana

Om samen te kunnen zijn met zijn vriendin in Engeland besluit Bilal, een Koerdische jongen van 17, het Kanaal over te zwemmen vanaf de Franse kant. Hij krijgt hulp van de lokale badmeester Simon die midden in een scheiding ligt met zijn vrouw.


